import React from 'react';

const Sidebar = () => {
  // Mock user data
  const userData = {
    name: "John Doe",
    email: "john@example.com",
    settings: {
      darkMode: true,
      notifications: true,
      language: "English",
    },
    walletBalance: 1000,
    interestEarned: 50,
  };

  return (
    <div className="bg-gray-800 text-white w-full md:w-64 h-full flex flex-col md:fixed md:left-0">
      <div className="p-4">
        <h1 className="text-2xl font-bold">{userData.name}</h1>
        <p className="text-sm">{userData.email}</p>
      </div>
      <div className="md:flex-1 md:overflow-y-auto">
        <ul className="py-4">
          <li className="px-4 py-2 hover:bg-gray-700 cursor-pointer">Dashboard</li>
          <li className="px-4 py-2 hover:bg-gray-700 cursor-pointer">Profile</li>
          <li className="px-4 py-2 hover:bg-gray-700 cursor-pointer">Settings</li>
          <li className="px-4 py-2 hover:bg-gray-700 cursor-pointer">Logout</li>
        </ul>
      </div>
      <div className="p-4">
        <h2 className="text-lg font-bold">User Info</h2>
        <p>Wallet Balance: ${userData.walletBalance}</p>
        <p>Interest Earned: ${userData.interestEarned}</p>
        <h2 className="text-lg font-bold mt-4">Settings</h2>
        <p>Dark Mode: {userData.settings.darkMode ? "Enabled" : "Disabled"}</p>
        <p>Notifications: {userData.settings.notifications ? "Enabled" : "Disabled"}</p>
        <p>Language: {userData.settings.language}</p>
      </div>
    </div>
  );
};

